	public static Skin downloadSkin(UUID ownerUUID) {
		if(ownerUUID == null) return null;
		String uuidString = ownerUUID.toString().replace("-", "") + "?unsigned=false";
		try {
			HttpURLConnection httpConnection = getConnection("https://sessionserver.mojang.com/session/minecraft/profile/" + uuidString);

			BufferedReader reader = new BufferedReader(new InputStreamReader(httpConnection.getInputStream()));
			String line = reader.readLine();
			if ((line == null) || (line.equals("null"))) {
				throw new RuntimeException("This uuid is cracked!");
			} else {
				TexturesModel texturesModel = (TexturesModel) new Gson().fromJson(line, TexturesModel.class);

				PropertiesModel[] properties = texturesModel.getProperties();
				if ((properties != null) && (properties.length > 0)) {
					PropertiesModel propertiesModel = properties[0];

					String encodedSkin = propertiesModel.getValue();
					String signature = propertiesModel.getSignature();

					return new Skin(ownerUUID.toString(), encodedSkin, signature);
				}
			}
		} catch (Exception e) {
			System.out.println("Error while downloading skin: "+e);
		}
		return null;
	}
	
	public static class TexturesModel {
		private String id, name;
		private PropertiesModel[] properties;

		public String getId() {
			return this.id;
		}

		public String getName() {
			return this.name;
		}

		public PropertiesModel[] getProperties() {
			return this.properties;
		}
	}
	
	public class PropertiesModel {
		private String name, value, signature;

		public String getName() {
			return this.name;
		}

		public String getValue() {
			return this.value;
		}

		public String getSignature() {
			return this.signature;
		}
	}

	private static HttpURLConnection getConnection(String url) throws IOException {
		HttpURLConnection httpConnection = (HttpURLConnection) new URL(url).openConnection();
		httpConnection.setConnectTimeout(3000);
		httpConnection.setReadTimeout(6000);
		httpConnection.setRequestProperty("Content-Type", "application/json");
		httpConnection.setRequestProperty("User-Agent", "VillagerAPI$SkinDownloader");
		return httpConnection;
	}
	
	public static GameProfile getFromCache(UUID uuid, String name){
		try {
			Class<?> gameProfileClass = Reflection.getClass("com.mojang.authlib.GameProfile");
			
			Class<?> tileEntitySkullClass = Reflection.getMinecraftClass("TileEntitySkull");
			Object cache = tileEntitySkullClass.getDeclaredField("skinCache").get(null);

			Class<?> loadingCacheClass = Reflection.getClass("com.google.common.cache.LoadingCache");
			Object skinProfile = loadingCacheClass.getDeclaredMethod("getUnchecked", new Class[] { Object.class })
					.invoke(cache, name);

			Reflection.FieldAccessor<?> idField = Reflection.getField(gameProfileClass, "id", UUID.class);
			idField.set(skinProfile, uuid);
			
			Reflection.FieldAccessor<?> nameField = Reflection.getField(gameProfileClass, "name", String.class);
			nameField.set(skinProfile, name);

			return (GameProfile) skinProfile;
		} catch (Exception e) {
			e.printStackTrace();
		}
		return null;
	}
	
	/* Class */
	private GameProfile profile;
	private String name, url, value, signature;
	
	public Skin(String name, String value, String signature){
		this.name = name;
		this.value = value;
		this.signature = signature;
		
		this.profile = new GameProfile(UUID.randomUUID(), name);
		this.profile.getProperties().put("textures", new Property("textures", value, signature));
	}
	
	public Skin(String name, UUID uuid, String value, String signature){
		this.name = name;
		this.value = value;
		this.signature = signature;
		
		this.profile = new GameProfile(uuid, name);
		this.profile.getProperties().put("textures", new Property("textures", value, signature));
	}
	
	public Skin(Player player){
		this.name = player.getName();
		this.profile = ((CraftPlayer) player).getProfile();
	}
	
	public Skin(String name, String url){
		this.name = name;
		this.url = url;
		
		this.profile = this.parse(name, url);
	}
	
	public Skin(UUID uuid, String name, String url){
		this.name = name;
		this.url = url;
		
		this.profile = this.parse(uuid, name, url);
	}

	public void setCape(Cape cape) throws ParseException {
		Collection<Property> properties = this.profile.getProperties().get("textures");
		Property skin = properties.iterator().next();
		Property result = new Property("textures", cape.set(skin.getValue()), skin.getSignature());
		this.profile.getProperties().put("textures", result);
	}
	
	public GameProfile parse(String name, String url) {
		if(url.isEmpty() || (!url.contains(":") && !url.contains("."))) new IllegalArgumentException("Invalid URL !");
		GameProfile profile = new GameProfile(UUID.randomUUID(), name);
		byte[] encodedData = Base64.encodeBase64(String.format("{textures:{SKIN:{url:\"%s\"}}}", url).getBytes());
		profile.getProperties().clear();
		profile.getProperties().put("textures", new Property("textures", new String(encodedData)));
		return profile;
	}
	
	public GameProfile parse(UUID uuid, String name, String url) {
		if(url.isEmpty() || (!url.contains(":") && !url.contains("."))) new IllegalArgumentException("Invalid URL !");
		GameProfile profile = new GameProfile(uuid, name);
		byte[] encodedData = Base64.encodeBase64(String.format("{textures:{SKIN:{url:\"%s\"}}}", url).getBytes());
		profile.getProperties().clear();
		profile.getProperties().put("textures", new Property("textures", new String(encodedData)));
		return profile;
	}
	
	public GameProfile apply(GameProfile profile) {
		if(url == null || url.isEmpty() || (!url.contains(":") && !url.contains("."))) new IllegalArgumentException("Invalid URL !");
		byte[] encodedData = Base64.encodeBase64(String.format("{textures:{SKIN:{url:\"%s\"}}}", url).getBytes());
		profile.getProperties().clear();
		profile.getProperties().put("textures", new Property("textures", new String(encodedData)));
		return profile;
	}
	
	public void setName(String name){
		Reflection.FieldAccessor<String> nameField = Reflection.getField(this.profile.getClass(), "name", String.class);
		nameField.set(this.profile, name);
	}
	
	public String getValue() {
		return value;
	}
	
	public String getSignature() {
		return signature;
	}
	
	public String getName() {
		return name;
	}
	
	public String getUrl() {
		return url;
	}
	
	public GameProfile get(){
		return profile;
	}
	
	public ItemStack toHead(String name) {
		ItemStack head = new ItemStack(Material.SKULL_ITEM, 1, (short) 3);

		SkullMeta headMeta = (SkullMeta) head.getItemMeta();
		Field profileField = null;
		try {
			profileField = headMeta.getClass().getDeclaredField("profile");
			profileField.setAccessible(true);
			profileField.set(headMeta, this.profile);
		} catch (Exception e) {
			e.printStackTrace();
		}
		headMeta.setDisplayName(name);
		head.setItemMeta(headMeta);
		return head;
	}

	public ItemStack toHead(String name, String url) {
		GameProfile profile = new GameProfile(UUID.randomUUID(), name);
		byte[] encodedData = Base64.encodeBase64(String.format("{textures:{SKIN:{url:\"%s\"}}}", url).getBytes());
		profile.getProperties().clear();
		profile.getProperties().put("textures", new Property("textures", new String(encodedData)));
		ItemStack head = new ItemStack(Material.SKULL_ITEM, 1, (short) 3);

		SkullMeta headMeta = (SkullMeta) head.getItemMeta();
		Field profileField;
		try {
			profileField = headMeta.getClass().getDeclaredField("profile");
			profileField.setAccessible(true);
			profileField.set(headMeta, profile);
		} catch (Exception e) {
			e.printStackTrace();
		}
		headMeta.setDisplayName(name);
		head.setItemMeta(headMeta);
		return head;
	}

	public static class Cape {

		private final String url;

		public Cape(String url){ this.url = url; }

		public String set(String textureValue) throws ParseException {
			String json = Base64Coder.decodeString(textureValue);
			JSONParser parser = new JSONParser();
			JSONObject object = (JSONObject) parser.parse(json);
			JSONObject textureArray = (JSONObject) object.get("textures");
			JSONObject cape = new JSONObject();
			cape.put("url", url);
			textureArray.put("CAPE", cape);
			object.put("textures", textureArray);
			return Base64Coder.encodeString(object.toJSONString());
		}

	}
	
